import React, { useState } from "react";
import LoginPage from "./Login";

export default function Home() {
	const [isSignedIn, setIsSignedIn] = useState(false);
	return isSignedIn ? (
		<div>
			<h1>Welcome, User</h1>
		</div>
	) : (
		<LoginPage />
	);
}
